    [],nt"revision_timestamp": "2016-11-17T19:58:12.099794",nt"name": "money-services-business-msb-registrant-search",nt"isopen":
    true,nt"url": null,nt"notes": "The MSB Registrant Search Web page contains
    entities that have registered as Money Services Businesses (MSBs) pursuant to the
    Bank Secrecy Act (BSA) regulations at 31 CFR 1022.380(a)-(f), administered by the
    Financial Crimes Enforcement Network (FinCEN). The MSB Registrant Search Web page
    reflects information exactly as provided by the registrant. Posted entries should
    include: (1) Registrant's legal name, (2) Registrant's "doing business as" name
    (if applicable), (3) Registrant's address, (4) MSB activities in which the Registrant
    engages, (5) states in which the Registrant engages in MSB activities, (6) number
    of branches, (7) date the registration form was signed, and (8) date the registration
    form was received.",nt"license_title": "Other License Specified",nt"extras":
